function InputDate(props) {
  const classNameInput = props.classNameInput
    ? `${props.classNameInput} input`
    : `input`;

  return (
    <>
      <label htmlFor={props.id} className={props.classNameLabel}>
        date
      </label>
      <input
        value={props.date}
        className={classNameInput}
        onChange={props.onClick}
        type="date"
        id={props.id}
        name={props.name}
        max={props.max}
        min={props.min}
      ></input>
    </>
  );
}

export default InputDate;
